define({"topics" : [{"title":"Common HTML-based processing","shortdesc":"<p class=\"shortdesc\">After the pre-processing operation runs, HTML-based builds each run a common series of Ant targets to     generate HTML file. Navigation may be created before or after this set of common routines.</p>","href":"reference\/XhtmlCommon.html","attributes": {"data-id":"XhtmlCommon",},"menu": {"hasChildren":false,},"tocID":"XhtmlCommon-d50e3492","topics":[]},{"title":"XHTML processing","shortdesc":"<p class=\"shortdesc\">After the XHTML files are generated by the common routine, the <code class=\"ph codeph\">dita.map.xhtml</code> target is     called by the <span class=\"keyword option\">xhtml</span> transformation. This target generates a TOC file called       <span class=\"ph filepath\">index.html</span>, which can be loaded into a frameset.</p>","href":"reference\/XhtmlDefault.html","attributes": {"data-id":"xhtmldefault",},"menu": {"hasChildren":false,},"tocID":"xhtmldefault-d50e3513","topics":[]},{"title":"HTML5 processing","shortdesc":"<p class=\"shortdesc\">After the HTML5 files are generated, the <span class=\"keyword option\">html5</span> transformation generates a table of     contents (ToC) file called <span class=\"ph filepath\">index.html</span>, which can be loaded as a cover page or rendered in a     navigation sidebar or menu via CSS.</p>","href":"reference\/html5.html","attributes": {"data-id":"ID",},"menu": {"hasChildren":false,},"tocID":"ID-d50e3543","topics":[]},{"title":"Eclipse help processing","shortdesc":"<p class=\"shortdesc\">The <span class=\"keyword option\">eclipsehelp</span> transformation generates XHTML-based output and files that are needed to     create an Eclipse Help system plug-in. Once the normal XHTML process has run, the <code class=\"ph codeph\">dita.map.eclipse</code>     target is used to create a set of control files and navigation files.</p>","href":"reference\/XhtmlEclipse.html","attributes": {"data-id":"xhtmleclipse",},"menu": {"hasChildren":false,},"tocID":"xhtmleclipse-d50e3570","topics":[]},{"title":"TocJS processing","shortdesc":"<p class=\"shortdesc\">The <span class=\"keyword option\">tocjs</span> transformation was originally created as a plug-in that was     distributed outside of the toolkit, but it now ships bundled in the default packages. This     HTML5-based output type creates a JavaScript-based frameset with TOC entries that expand and     collapse.</p>","href":"reference\/XhtmlTocjs.html","attributes": {"data-id":"xhtmltocjs",},"menu": {"hasChildren":false,},"tocID":"xhtmltocjs-d50e3597","topics":[]},{"title":"HTML Help processing","shortdesc":"<p class=\"shortdesc\">The <span class=\"keyword option\">htmlhelp</span> transformation creates HTML Help control files. If the     build runs on a system that has the HTML Help compiler installed, the control files are compiled     into a CHM file.</p>","href":"reference\/XhtmlCHM.html","attributes": {"data-id":"xhtmlchm",},"menu": {"hasChildren":false,},"tocID":"xhtmlchm-d50e3621","topics":[]}]});